/* View: NEW_VIEW */
CREATE VIEW NEW_VIEW(
    USER_ID,
    ISO3166_1A2,
    STATESHORT,
    PERSONALNR,
    LASTFIRST)
AS
SELECT 
    SYS_USER.USER_ID,
    GEO_COUNTRY.ISO3166_1A2,
    GEO_STATE.STATESHORT,
    SYS_USER.PERSONALNR,
   -- SYS_USER.USERNAME,
    SYS_USER.LASTNAME || ', ' || SYS_USER.FIRSTNAME AS LASTFIRST

FROM SYS_USER
   INNER JOIN GEO_COUNTRY ON (SYS_USER.COUNTRY_ID = GEO_COUNTRY.COUNTRY_ID)
   INNER JOIN GEO_STATE ON (SYS_USER.STATE_ID = GEO_STATE.STATE_ID)
WHERE 
   (
      (SYS_USER.ACTIVEX = 1)
   )
;



/* View: V_COUNTRYLIST */
CREATE VIEW V_COUNTRYLIST(
    COUNTRY_ID,
    ISO3166_1A2,
    COUNTRY,
    LANGUAGE_ID)
AS
SELECT 
    GEO_COUNTRY.COUNTRY_ID,
    GEO_COUNTRY.ISO3166_1A2,
    GEO_COUNTRYRES.COUNTRY,
    GEO_COUNTRYRES.LANGUAGE_ID
FROM GEO_COUNTRYRES
   INNER JOIN GEO_COUNTRY ON (GEO_COUNTRYRES.COUNTRY_ID = GEO_COUNTRY.COUNTRY_ID)
WHERE 
   (
      (GEO_COUNTRY.ACTIVEX = 1)
   AND 
      (GEO_COUNTRYRES.LANGUAGE_ID = 32)
   )
;



/* View: V_LANGUAGE */
CREATE VIEW V_LANGUAGE(
    LANGUAGE_ID,
    LANGUAGE,
    ISO639_1)
AS
SELECT 
    GEO_LANGUAGE.LANGUAGE_ID,
    GEO_LANGUAGERES.LANGUAGE,
    GEO_LANGUAGE.ISO639_1
FROM GEO_LANGUAGERES
   INNER JOIN GEO_LANGUAGE ON (GEO_LANGUAGERES.LANGUAGE_ID = GEO_LANGUAGE.LANGUAGE_ID) AND (GEO_LANGUAGERES.ISO639_1 = GEO_LANGUAGE.ISO639_1)
WHERE 
   (
      (GEO_LANGUAGE.ACTIVEX = 1)
   )
;



/* View: V_STATESLIST */
CREATE VIEW V_STATESLIST(
    STATE_ID,
    STATESHORT,
    STATE)
AS
SELECT 
    GEO_STATE.STATE_ID,
    GEO_STATE.STATESHORT,
    GEO_STATE.STATE
FROM GEO_STATE
WHERE 
   (
      (GEO_STATE.ACTIVEX = 1)
   )
;



/* View: V_USERYEARDAYS */
CREATE VIEW V_USERYEARDAYS(
    USER_ID,
    UYEAR,
    USERYEAR_ID,
    ISO3166_1A2,
    STATESHORT,
    PERSONALNR,
    LASTFIRST)
AS
SELECT 
    SYS_USER.USER_ID,
    SYS_USERYEAR.UYEAR,
     SYS_USERYEAR.USERYEAR_ID,
    GEO_COUNTRY.ISO3166_1A2,
    GEO_STATE.STATESHORT,
    SYS_USER.PERSONALNR,
    SYS_USER.LASTNAME || ', ' || SYS_USER.FIRSTNAME AS LASTFIRST

FROM SYS_USERYEAR
   INNER JOIN SYS_USER ON (SYS_USERYEAR.USER_ID = SYS_USER.USER_ID)
   INNER JOIN GEO_COUNTRY ON (SYS_USER.COUNTRY_ID = GEO_COUNTRY.COUNTRY_ID)
   INNER JOIN GEO_STATE ON (SYS_USER.STATE_ID = GEO_STATE.STATE_ID)
WHERE 
   (
      (SYS_USER.ACTIVEX = 1)
   )
;




