ALTER PROCEDURE P_ADD_EXTRAHOLIDAYS (
    IN_COUNTRY_ID INTEGER)
AS
DECLARE VARIABLE HOLIEXTRAS_ID INTEGER;
DECLARE VARIABLE COUNTRY_ID INTEGER;
DECLARE VARIABLE STATE_ID INTEGER;
DECLARE VARIABLE HDATE DATE;
DECLARE VARIABLE HNAME VARCHAR(50);
DECLARE VARIABLE HCOST NUMERIC(2,2);
DECLARE VARIABLE EXISTING_COUNT INTEGER;

BEGIN
  FOR SELECT HOLIEXTRAS_ID, COUNTRY_ID, STATE_ID, HDATE, HNAME, HCOST
      FROM HOLIEXTRAS
      WHERE COUNTRY_ID = :IN_COUNTRY_ID
      INTO :HOLIEXTRAS_ID, :COUNTRY_ID, :STATE_ID, :HDATE, :HNAME, :HCOST
  DO
  BEGIN
    -- Prüfe, ob das Datum bereits in der Tabelle HOLIDAYSDAT existiert
    SELECT COUNT(*)
    FROM HOLIDAYSDAT
    WHERE HDATE = :HDATE
    INTO :EXISTING_COUNT;

    IF (EXISTING_COUNT = 0) THEN
    BEGIN
      -- Das Datum existiert noch nicht, führe das Einfügen durch
      VALUES (GEN_ID(GEN_HOLIDAYSDAT_ID, 1), :HOLIEXTRAS_ID, GEN_ID(GEN_HOLIDAYS_ID, 1), :HDATE, :HNAME, :HCOST);
    END
  END
END^


