ALTER PROCEDURE P_GET_USER_IDS (
    VUSER_ID INTEGER,
    VYEAR INTEGER)
RETURNS (
    VUSERYEAR_ID INTEGER,
    VSTATE_ID INTEGER,
    VWORKINGGROUP_ID INTEGER,
    VCOUNTRY_ID INTEGER,
    VWORKINGHOURS_ID INTEGER,
    VHOLIDAYS_ID INTEGER)
AS
BEGIN
  FOR SELECT
        SYS_USERYEAR.USERYEAR_ID,
        SYS_USER.STATE_ID,
        SYS_USER.WORKINGGROUP_ID,
        SYS_USER.COUNTRY_ID,
        WORKINGHOURS.WORKINGHOURS_ID
      FROM SYS_USERYEAR
      INNER JOIN SYS_USER ON (SYS_USERYEAR.USER_ID = SYS_USER.USER_ID)
      INNER JOIN WORKINGHOURS ON (SYS_USER.COUNTRY_ID = WORKINGHOURS.COUNTRY_ID)
      WHERE SYS_USERYEAR.UYEAR = :VYEAR AND
            SYS_USER.USER_ID = :VUSER_ID AND
            WORKINGHOURS.WYEAR = :VYEAR
      INTO :VUSERYEAR_ID, :VSTATE_ID, :VWORKINGGROUP_ID, :VCOUNTRY_ID, :VWORKINGHOURS_ID
  DO

    FOR SELECT
          H.HOLIDAYS_ID
        FROM HOLIDAYS H
        WHERE H.HYEAR = :VYEAR AND
              H.COUNTRY_ID = :VCOUNTRY_ID AND
              H.STATE_ID = :VSTATE_ID
        INTO :VHOLIDAYS_ID

    DO


        SUSPEND;


END^


ALTER PROCEDURE P_INS_1USERYEARDAYS (
    USER_ID INTEGER,
    V_YEAR INTEGER)
RETURNS (
    RESULT INTEGER)
AS
DECLARE VARIABLE V_CURRENT_DATE DATE;
DECLARE VARIABLE V_CURRENT_YEAR INTEGER;
BEGIN
  V_CURRENT_YEAR = :V_YEAR;
  V_CURRENT_DATE = CAST(:V_CURRENT_YEAR || '-01-01' AS DATE);

  VALUES (:USER_ID, :V_YEAR)
  RETURNING USERYEAR_ID
  INTO RESULT;
  --:RESULT;

  WHILE (EXTRACT(YEAR FROM :V_CURRENT_DATE) = :V_CURRENT_YEAR) DO
  BEGIN
    VALUES (DEFAULT, :RESULT, :V_CURRENT_DATE);
    V_CURRENT_DATE = :V_CURRENT_DATE + 1;
  END
  SUSPEND;
END^


