ALTER PROCEDURE TEST (
    YY INTEGER)
RETURNS (
    TEST INTEGER)
AS
DECLARE VARIABLE DAYS_IN_YEAR INTEGER;
begin
   /* Check if the year is a leap year */
  IF ( Mod(:yy,4) = 0 AND (Mod(:yy,100)  <> 0 OR Mod(:yy, 400) = 0)) THEN
    DAYS_IN_YEAR = 366; /* Leap year has 366 days */
  ELSE
    DAYS_IN_YEAR = 365 ;


end^



